import React from "react";
import { Link } from "react-router-dom";
import { Container } from "./NavbarItem.styles";
const NavbarItem = ({ link, title }) => {
  const handleClick = () => {
    console.log("invoked");
  };
  return (
    <Container>
      <Link onClick={handleClick} to={link}>
        {title}
      </Link>
    </Container>
  );
};

export default NavbarItem;
